// n8n Code node: parse stdout/binary CSV -> JSON items + binary CSV (with BOM for Excel)
// Usage: connect Execute Command (or ReadBinaryFile) -> this Code node -> optional Write Binary File (to save CSV)
// The node reads from $input.first().json.stdout or from $input.first().binary.data.data (base64).

try {
  const raw = $input.first()?.json?.stdout ?? (
    $input.first()?.binary?.data?.data
      ? Buffer.from($input.first().binary.data.data, 'base64').toString('utf8')
      : null
  );

  if (!raw) {
    return [{ json: { error: 'no_input' } }];
  }

  // Normalize newlines
  const text = raw.replace(/\r\n/g, '\n').replace(/\r/g, '\n');

  // Robust CSV parser (handles quoted fields, doubled quotes, delimiter = ';')
  function parseCSV(s, delimiter = ';') {
    const rows = [];
    let cur = '';
    let row = [];
    let inQuotes = false;
    for (let i = 0; i < s.length; i++) {
      const ch = s[i];
      if (inQuotes) {
        if (ch === '"') {
          if (i + 1 < s.length && s[i + 1] === '"') {
            cur += '"';
            i++;
          } else {
            inQuotes = false;
          }
        } else {
          cur += ch;
        }
      } else {
        if (ch === '"') {
          inQuotes = true;
        } else if (ch === delimiter) {
          row.push(cur);
          cur = '';
        } else if (ch === '\n') {
          row.push(cur);
          cur = '';
          rows.push(row);
          row = [];
        } else {
          cur += ch;
        }
      }
    }
    if (cur !== '' || row.length > 0) {
      row.push(cur);
      rows.push(row);
    }
    return rows;
  }

  const rowsAll = parseCSV(text, ';');
  if (!rowsAll || rowsAll.length === 0) {
    return [{ json: { error: 'no_rows' } }];
  }

  // Header (keep original header text for CSV output, but create safe JSON keys)
  const header = rowsAll.shift().map(h => (h ?? '').toString().trim());

  function sanitizeKey(k, idx) {
    if (!k || k.trim() === '') return `col_${idx + 1}`;
    return k.trim().replace(/\s+/g, '_').replace(/[^\w\-]/g, '_');
  }
  const keys = header.map((h, i) => sanitizeKey(h, i));

  // Optional cleanup: strip trailing .0 from integer-looking numeric codes (e.g., "5540209.0" -> "5540209")
  function cleanValue(v) {
    if (v == null) return '';
    const s = v.toString();
    const trimmed = s.trim();
    if (/^\d+(\.0+)?$/.test(trimmed)) return trimmed.replace(/\.0+$/, '');
    return trimmed;
  }

  // Build JSON items
  const itemsJson = rowsAll.map(r => {
    const obj = {};
    for (let i = 0; i < keys.length; i++) {
      obj[keys[i]] = (r[i] !== undefined) ? cleanValue(r[i]) : '';
    }
    return obj;
  });

  // Build CSV text again (quote fields when needed) and include BOM for Excel
  function quoteField(f) {
    if (f === null || f === undefined) return '';
    const s = f.toString();
    if (s.indexOf(';') !== -1 || s.indexOf('"') !== -1 || s.indexOf('\n') !== -1 || s.indexOf('\r') !== -1) {
      return '"' + s.replace(/"/g, '""') + '"';
    }
    return s;
  }

  const outLines = [ header.map(quoteField).join(';') ];
  for (const r of rowsAll) {
    const cols = [];
    for (let i = 0; i < keys.length; i++) {
      cols.push(quoteField((r[i] !== undefined) ? cleanValue(r[i]) : ''));
    }
    outLines.push(cols.join(';'));
  }
  const csvText = outLines.join('\r\n') + '\r\n';
  const csvBase64 = Buffer.from('\uFEFF' + csvText, 'utf8').toString('base64'); // BOM added

  // Pick a sensible filename: prefer incoming $input.first().json.code if present, else 'matches'
  const codeVal = $input.first()?.json?.code ?? itemsJson[0]?.ua_customer_code ?? 'result';
  const filename = `matches_${codeVal}.csv`;

  // Prepare output: first element contains binary CSV (for Write Binary File), then JSON items
  const output = [];

  // summary + binary on first element
  output.push({
    json: {
      _summary: {
        row_count: itemsJson.length,
        filename
      },
      // put first row also inside json for convenience if you need it
      first_row: itemsJson.length ? itemsJson[0] : null
    },
    binary: {
      data: {
        data: csvBase64,
        fileName: filename,
        mimeType: 'text/csv; charset=utf-8'
      }
    }
  });

  // remaining JSON rows as separate items (useful for Spreadsheet/Google Sheets nodes)
  for (let i = 0; i < itemsJson.length; i++) {
    output.push({ json: itemsJson[i] });
  }

  return output;
} catch (err) {
  return [{ json: { error: true, message: err.message, stack: err.stack } }];
}

